                }
                .violations {
                    margin: 30px 0;
                }
                .violations h2 {
                    color: #e74c3c;
                    margin-bottom: 15px;

                table {

                    margin: 10px 0;
                }
                th, td {
                    padding: 12px;

                    border-bottom: 1px solid #ddd;
                }
                th {
                    background-color: #34495e;
                    color: white;
                    font-weight: 600;
                }
                tr:hover {
                    background-color: #f5f5f5;
                }
                .chart-container {
                    margin: 30px 0;
                }
            </style>
